import React from 'react';
import logo from './logo.svg';
import './App.css';

// alert('Let start')

function App() {
  return (
    <div>
      <h1><AppTitle /></h1>
      <DropList />
      <Rating />
    </div>
  );
}

function AppTitle() {
  return (
    <React.Fragment>This is APP</React.Fragment>
  )
}

function DropList() {
  return (
  <div>
    <DropListTitle />
    <DropListBody />

    <ul>
      <li>One</li>
      <li>Two</li>
      <li>Three</li>
    </ul>
  </div>
  )
}

function DropListTitle() {
  return (
    <><h3>Title 1</h3></>
  )
}

function Rating() {
  return (
    <div>
      <Star />
      <Star />
      <Star />
      <Star />
      <Star />
    </div>
  )
}


function Star() {
  console.log('Popal')
  return (
    <div><em>STAR</em></div>
  )
}

export default App;
